import React, { useState, useEffect } from "react";

const getStars = () => {
  fetch("http://localhost:777/getStars", {
    method: "GET",
    headers: {
      "Content-Type": "application/json",
    },
  })
    .then((response) => response.json())
    .then((data) => {
      return data;
    });
};

function App() {
  return <div>{getStars()}</div>;
}

export default App;
